package com.apex.platform.stringmanipulation;

import java.util.HashMap;
import java.util.Map;

public class AlternativeCharacters
{
	static final String AB = "AB";

	public static void main(String[] args)
	{
		//String s = "";
		//String s = "";
		//String s = "AABAAB";
		//String s = "AAABBB";
		//String s = "AAAA";
		String s = "";
		for (int i = 1000000; i > 0; i--)
		{
			s = s + "A";
		}
		int length = s.length();
		//char[] charArr = s.toCharArray();
		for (int i = 0; i < s.length(); i++)
		{
			char c = s.charAt(i);
			if (i >= 0 && i < s.length() - 1)
			{
				if (s.charAt(i + 1) == c)
				{
					s = s.replaceFirst("" + s.charAt(i + 1), "");
					//charMap.remove(charArr[i - 1]);
				}
			}
		}
		//charArr = null;
		//return (length - s.length());
		System.out.println("Final String: " + s);
		System.out.println("Final String: " + s);
		System.out.println("Deleted Character from a given string : " + (length - s.length()));
	}

	private static Map<Integer, String> findPositionsOfAB(String s)
	{
		Map<Integer, String> posMap = new HashMap<Integer, String>();
		for (int i = 0; i < s.length(); i++)
		{
			int ind = s.indexOf(AB);
			if (ind != -1)
			{
				System.out.println("ind : " + ind + " Char: " + AB);
				posMap.put(ind, AB);
				return posMap;
			}
		}

		return null;
	}

}
